import React, {Router} from "react";
import Header from "./Components/Header";
import ArticlesPage from "./Components/ArticlesPage";
import "./App.css";

class App extends React.Component {
  state = {};
  render() {
    return (
      <div className="App">
        <Header />
        <Router>
          <ArticlesPage path="/" />
        </Router>
      </div>
    );
  }
}

export default App;
